import React from 'react';
import Burger from './Burger';

 
const Navbar = () => {
  return (
      <div className="navbar">
        <div classNameeeee="logo">
            Nav Bar
        </div>
        <ul>
            <li>Home</li>
            <li>About Us</li>
            <li>Contact Us</li>
            <li>Sign In</li>
            <li>Sign Up</li>
        </ul>
      </div>
  )
}

export default Navbar
